import React from "react";
import "./App.css";
import { Link } from "react-router-dom";

// navbar 
function Nav() {
  return (
    <nav>
      <ul className="nav-links">
        <Link to="/home" className="anchor">
          <li>Home</li>
        </Link>
        <Link to="/search" className="anchor">
          <li>Search</li>
        </Link>
        <Link to="/houses" className="anchor">
          <li>Houses</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
